// Creando un objeto con propiedades.
const pc = {
    cpu: 'Ryzen 5 5950x',
    gpu: 'Nvidia RTX 3090',
    tienda: 'DDTech',
    precio: 60000
}

// Utilizar la desestructuración de objetos para crear variables individuales con la información del objeto.
const { cpu, gpu, tienda, precio } = pc;

console.log(cpu);
console.log(gpu);
console.log(tienda);
console.log(precio);
